const styles = {
  root: {
    flexGrow: 1,
  },
  title: {
    flexGrow: 1,
    textDecoration: "none",
    color: "white",
  },
  right: {
    underline: "none",
    color: "white",
    textDecoration: "none",
    margin: "0 2vw",
  },
  appbar: {
    backgroundColor: "#2E3B55",
  },
};

export default styles;
